property.code:
#set ($attachmentName = 'codemirror.zip')
var codeMirrors = [];
const TIMEOUT_VALUE = 150;

// FIXME: Replace with XWiki.isDomLoaded when upgrading to 3.1.1. http://jira.xwiki.org/jira/browse/XWIKI-6754
if (XWiki.isInitialized) {
  initCodeMirrorInternals();
} else {
  document.observe('xwiki:dom:loaded', function() {
    initCodeMirrorInternals();    
  });
}

/* Initialize the CodeMirror library and then start registering the extra modules. */
var initCodeMirrorInternals = function() {
  // CodeMirror js
  importScript("$xwiki.zipexplorer.getFileLink($doc, $attachmentName, 'lib/codemirror.js')");

  initCodeMirrorModules();
}

/* Initialize extra CodeMirror modules and then attach them to the compatible controls. */
var initCodeMirrorModules = function() {
  if (typeof(CodeMirror) != "function" || typeof(CodeMirror.prototype) != "object") {
    // The download + loading of the CodeMirror js is done asynchronously, so we need to wait for it to load.
    setTimeout(initCodeMirrorModules, TIMEOUT_VALUE);
  } else {
    // CSS Mode
    importScript("$xwiki.zipexplorer.getFileLink($doc, $attachmentName, 'mode/css/css.js')");
    // JavaScript Mode
    importScript("$xwiki.zipexplorer.getFileLink($doc, $attachmentName, 'mode/javascript/javascript.js')");
    // Velocity
    importScript("$xwiki.zipexplorer.getFileLink($doc, $attachmentName, 'mode/velocity/velocity.js')");
    // XWiki Syntax/Macros
    importScript("$xwiki.zipexplorer.getFileLink($doc, $attachmentName, 'mode/xwikitags/xwikitags.js')");
    // XWiki Mode (mixed mode of all the above + XML/HTML)
    importScript("$xwiki.zipexplorer.getFileLink($doc, $attachmentName, 'mode/xml/xml.js')");
    importScript("$xwiki.zipexplorer.getFileLink($doc, $attachmentName, 'mode/xwiki/xwiki.js')");

    initCodeMirrors();
  }
}

/* Initialize all possible CodeMirror instances. */
var initCodeMirrors = function () {
  initCodeMirror("textarea[id^='XWiki.StyleSheetExtension_'][id$='_code']",
                 "div[id^='xobject_XWiki.StyleSheetExtension_'][id$='_title']",
                 'css');
  initCodeMirror("textarea[id^='XWiki.JavaScriptExtension_'][id$='_code']",
                 "div[id^='xobject_XWiki.JavaScriptExtension_'][id$='_title']",
                 'javascript');
  initCodeMirror("textarea[id^='XWiki.XWikiSkins_'][id$='.css']",
                 "div[id^='xobject_XWiki.XWikiSkins_'][id$='_title']",
                 'css');
  initCodeMirror("textarea[id^='XWiki.XWikiSkins_'][id$='.js']",
                 "div[id^='xobject_XWiki.XWikiSkins_'][id$='_title']",
                 'javascript');
  initCodeMirror("textarea[id='content']", '', 'xwiki');
}

/* Initialize a CodeMirror instance and add it to the list of instances.
* @param propertyPattern : the CSS selector for the textarea to wrap with a CodeMirror instance.
* @param objectTitlePattern : the CSS selector for an XWiki object that contains a TextArea field editable
*    with a CodeMirror instance. Applies for the object editor only. It basically registers a click listener
*    that will refresh the CodeMirror instance when it becomes visible.
* @param codeMirrorMode : the mode that will be used by this CodeMirror instance ('css', 'javascript', etc.)
*/
var initCodeMirror = function (propertyPattern, objectTitlePattern, codeMirrorMode) {
  if (CodeMirror.listModes().indexOf(codeMirrorMode) == -1) {
    // The download + loading of each CodeMirror module js is done asynchronously, so we need to wait for it to load.
    setTimeout(function() {initCodeMirror(propertyPattern, objectTitlePattern, codeMirrorMode)}, TIMEOUT_VALUE);
  } else {
  //
  // Attach codeMirrors to all the elements matched with the propertyPattern.
  //
  var textareas = $$(propertyPattern);
  for (var i = 0; i<textareas.length; ++i) {
    var textarea = textareas[i];
    var codeMirror = CodeMirror.fromTextArea(textarea, {
      'mode' : codeMirrorMode,
      'lineNumbers' : true,
      'matchBrackets' : true,
      'tabMode' : 'shift',
      /* Full Screen on F11. */
      onKeyEvent: function(i, e) {
          // Hook into F11
          if ((e.keyCode == 122 || e.keyCode == 27) && e.type == 'keydown') {
            e.stop();
            return toggleFullscreenEditing(codeMirror);
          }
        },
      /* Active line highlighting. */
      onCursorActivity: function() {
        /* Clear previous line highlighting. */
        codeMirror.setLineClass(hlLine, null);
        /* Highlight current line. */
        hlLine = codeMirror.setLineClass(codeMirror.getCursor().line, "activeline");
      }
    });
    var hlLine = codeMirror.setLineClass(0, "activeline");
    
    codeMirrors.push(codeMirror);
  }
  
  //
  // Attach listeners for when expanding an object in the object editor.
  //
  if (objectTitlePattern != null && objectTitlePattern != '') {
    var titleElements = $$(objectTitlePattern);
    for (var i=0; i<titleElements.length; ++i) {
      var titleElement = titleElements[i];
      titleElement.observe('click', expandTitleElement);
    }
  }

  // else-end
  }
}
    
/* Display the given codeMirror instance in full screen. */
var toggleFullscreenEditing = function (codeMirror) {
  var wrapper = codeMirror.getWrapperElement();
  var editorDiv = wrapper.select('.CodeMirror-scroll')[0];
  if (!editorDiv.hasClassName('fullscreen')) {
    toggleFullscreenEditing.beforeFullscreen = { height: editorDiv.height, width: editorDiv.width }
    editorDiv.addClassName('fullscreen');
    editorDiv.height = '100%';
    editorDiv.width ='100%';
    codeMirror.refresh();
    codeMirror.focus();
  }
  else {
    editorDiv.removeClassName('fullscreen');
    editorDiv.height = toggleFullscreenEditing.beforeFullscreen.height;
    editorDiv.width = toggleFullscreenEditing.beforeFullscreen.width;
    codeMirror.refresh();
  }
}

/* Refresh all registered codeMirrors that are attached to textareas of the expanded XWiki object. */
var expandTitleElement = function (event) {
  var element = Event.element(event);

  var textareas = element.up('.xobject').select('textarea');
  for(var i=0; i<textareas.length; ++i) {
    var textarea = textareas[i];
    var codeMirror = getCodeMirrorFromInternalTextArea(textarea, codeMirrors);
    // codeMirror can be null if the current textarea is the original (currently hidden) textarea and not a CodeMirror internal one.
    if (codeMirror) {
      codeMirror.refresh();
    }
  }

  /* Remove the listener. */
  element.stopObserving('click', expandTitleElement);
}
    
var getCodeMirrorFromInternalTextArea = function(textArea, codeMirrors) {
  for(var j=0; j<codeMirrors.length; ++j) {
    var codeMirror = codeMirrors[j];
    var codeMirrorTextArea = codeMirror.getInputField();
    if (textArea == codeMirrorTextArea) {
      return codeMirror;
    }
  }
}

/* Synchronize the original textareas' contents with the codemirrors' contents just before saving the page. */
document.observe('xwiki:actions:save', function(event){
  for (var i=0; i < codeMirrors.length; ++i) {
    codeMirrors[i].save();
  }
});

/* Full screen editing when pressing the maximize button. */
document.observe('xwiki:fullscreen:enter', function(event){
  Event.stop(event);
  
  var originalTextArea = event.memo.target;
  var codeMirrorTextArea = originalTextArea.up().down('.CodeMirror textarea');
  
  var codeMirror = getCodeMirrorFromInternalTextArea(codeMirrorTextArea, codeMirrors);
  
  toggleFullscreenEditing(codeMirror);
});

/*
 * Utility methods.
 */

/* Inject an extra javascript script tag into the current DOM using the given script location/source. */
var importScript = function(src) {
  var script_tag = document.createElement('script');
  script_tag.type = "text/javascript";
  script_tag.src = src;

  document.getElementsByTagName('head')[0].appendChild(script_tag);
}

